const CounterInfo = ({volcanoes, wildfires, storms}) => {
    return (
        <div className="location-info">
            <h2>Event Location Info</h2>
            <ul>
                <li>volcanoes: <strong>{ volcanoes }</strong></li>
                <li>wildfires: <strong>{ wildfires }</strong></li>
                <li>NAME: <strong>{ storms }</strong></li>
            </ul>
        </div>
    )
}

export default CounterInfo
